import React, { useEffect, useState } from 'react';

const ActiveUsers = () => {
    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    app.get('/active_users', (req, res) => {
        try {
          // fetch data logic
          res.json(users);
        } catch (error) {
          res.status(500).json({ error: "Internal Server Error" });
        }
      });


    useEffect(() => {
        // Make sure to replace 'http://localhost:3000' with your actual server address and port
        fetch('http://localhost:3000/active_users')
            .then(response => {
                // Check if the response is ok (status in the range 200-299)
                if (!response.ok) {
                    throw new Error('Network response was not ok: ' + response.statusText);
                }
                return response.json();
            })
            .then(data => {
                setUsers(data);
                setLoading(false);
            })
            .catch(err => {
                console.error('Failed to fetch active users:', err);
                setError('Failed to load data: ' + err.message);
                setLoading(false);
            });
    }, []);

    if (loading) return <div>Loading active users...</div>;
    if (error) return <div>Error loading active users: {error}</div>;
    if (!users.length) return <div>No active users found!</div>;

    return (
        <div>
            <h2>Active Users</h2>
            <table>
                <thead>
                    <tr>
                        <th>User ID</th>
                        <th>Name</th>
                        <th>Review Count</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map(user => (
                        <tr key={user.user_id}>
                            <td>{user.user_id}</td>
                            <td>{user.name}</td>
                            <td>{user.review_count}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ActiveUsers;
